Den automatiska säkerhetskopian skapades med fel:
* Platser som säkerhetskopian inte kunde laddas upp till: {failed_agents}
* Tillägg som inte kunde säkerhetskopieras: {failed_addons}
* Mappar som inte kunde säkerhetskopieras: {failed_folders}

Kontrollera core- och supervisor-loggarna för mer information. Ett nytt försök kommer att göras vid nästa schemalagda tidpunkt om ett schema för säkerhetskopiering har konfigurerats.
